import React from 'react'
import "../styles.css"
import Base from './Base'


const Cart =() => {
  const loadallProducts=()=>
  {
    return(
      <div>
        Products
      </div>

    )
  }

  const loadCheckout =() =>
  {
    return(
    <div>
      <h1>Checkout</h1>
    </div>
    )
  }
  return (
    <Base>
      <div className='row text-center'>
        <div className='col-3'>
          {loadallProducts}
        </div>
        <div className='col-9'>
          {loadCheckout}
        </div>
      </div>
      </Base>
  )
}

export default Cart;
